import axios from "axios";
import { useEffect, useState } from "react"; //to use function to get information  and useState to store data
import { Table } from "react-bootstrap";

function DoctAss() {

    const [doctors,setdoctor] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:4000/doctorAss", { withCredentials: true })
            .then(res => {
                setdoctor(res.data.drassigmnent.dr);
            }).catch(err => console.log(err));
    }, [])

    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>#</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Username</th>
                </tr>
            </thead>
            <tbody>
               {doctors.map()

               }
            </tbody>
        </Table>
    )
}

export default DoctAss;
